import { Button, SafeAreaView, View, Text } from "react-native-web";
import { endpoints } from "../Endpoints/endpoints";
import DataView from "./Dataview";
import { dataview } from "../styles/Dataview";

const Card = ({ item }) => {
    console.log(item);
    return (
        <SafeAreaView style={dataview.card} >
            <View >
                <View >
                    <Text style={dataview.textStyle}>Chetan</Text>
                </View>
            </View>
        </SafeAreaView>
    )
}

export const ShowFile = ({ route, navigation }) => {
    console.log(route);
    const { id } = route?.params;

    const queryKey = [id, "Images"]

    const queryFunction = async () => {
        var data = await endpoints.File.getAll(null, { id: id })
        console.log(data);
        return data
    }
    const getValueToSearch = (current) => {
        return (
            ""
        )
    }

    return (
        <SafeAreaView >
            <DataView
                queryFunction={queryFunction}
                queryKey={queryKey}
                getSearchableValue={getValueToSearch}
                Card={Card}
                dataviewTitle={"Users"}
                navigation={navigation}
            />
        </SafeAreaView>

    )
}
